script: |
  super -f text -I q10125.spq | sort > q10125.out

inputs:
  - name: q10125.spq
    data: |
      SELECT ALL + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE col0 / - col1 BETWEEN - col2 AND ( col1 / col1 + col0 * col1 * tab0.col2 );
  - name: tab0

outputs:
  - name: q10125.out
    data: |
      86
      91
      97
